  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Necedah NWR outlines
  Refuge accomplishments from January through April of 1960. The report begins by
  summarizing the weather conditions, habitat conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  furbearers, predators, rodents, mammals, raptors, reptiles, fish, and disease- is
  also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, collections and receipts, and prescribed burning. Resource
  management is outlined; topics include fur harvesting. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  and hunting. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
